import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Login from './../../Containers/Login/Login';

export const RoutesWithSesion = () => (
  <Switch>
    <Route to="/" component={Login} />
  </Switch>
)

export const RoutesWithoutSesion = () => (
  <Switch>
    <Route to="/" component={Login} />
  </Switch>
)
